use std::env::current_dir;

use gen_components::{GButtonWidgetRefExt, GImageWidgetRefExt};
// App.rs
use makepad_widgets::*;

live_design! {
    use link::theme::*;
    use link::shaders::*;
    use link::widgets::*;
    use link::gen_components::*;
    IMG_DEFAULT_AVATAR = dep("crate://self/resources/default_avatar.png")
    App = {{App}} {
        ui: <Root>{
            main_window = <Window>{
                body = <ScrollXYView>{
                    flow: Down,
                    spacing: 16,
                    align: {
                        x: 0.5,
                        y: 0.5
                    },
                    show_bg: true,
                    draw_bg:{
                        fn pixel(self) -> vec4 {
                            return #2A2E37;
                        }
                    }
                    <GLabel>{
                        font_size: 16,
                        text: "Hello World",
                    }
                    img = <GImage>{
                        height: Fill,
                        width: Fill,
                        // src: File("/Users/shengyifei/projects/gen_ui/made_with_GenUI/components_test/resources/default_avatar.png"),
                        src: Url("https://avatars.githubusercontent.com/u/67356158?s=48&v=4")
                    }
                    btn1 = <GButton> {
                        slot: {
                            text: "Local"
                        }
                    }
                    btn2 = <GButton> {
                        slot: {
                            text: "base64"
                        }
                    }
                    btn3 = <GButton> {
                        slot: {
                            text: "http-url"
                        }
                    }
                }
            }
        }
    }
}

#[derive(Live, LiveHook)]
pub struct App {
    #[live]
    ui: WidgetRef,
}

impl LiveRegister for App {
    fn live_register(cx: &mut Cx) {
        crate::makepad_widgets::live_design(cx);
        crate::gen_components::live_design(cx, None);
    }
}

impl MatchEvent for App {
    fn handle_actions(&mut self, cx: &mut Cx, actions: &Actions) {
        let img = self.ui.gimage(id!(img));
        if let Some(_) = self.ui.gbutton(id!(btn1)).clicked(actions) {
            let current = current_dir().unwrap().join("resources/dek.png");
            img.load(cx, current.display().to_string().as_str()).unwrap();
            // self.ui.redraw(cx);
        }
        if let Some(_) = self.ui.gbutton(id!(btn2)).clicked(actions) {
        
            img.load(cx, PNG).unwrap();
            // self.ui.redraw(cx);
        }
        if let Some(_) = self.ui.gbutton(id!(btn3)).clicked(actions) {
            img.load(cx, "https://avatars.githubusercontent.com/u/67356158?s=48&v=4").unwrap();
            // self.ui.redraw(cx);
        }
    }
}

impl AppMain for App {
    fn handle_event(&mut self, cx: &mut Cx, event: &Event) {
        self.match_event(cx, event);
        self.ui.handle_event(cx, event, &mut Scope::empty());
    }
}

app_main!(App);

const PNG: &str = r#"data:image/png;base64,"#;